import React from "React";
import Link from "next/link";
import axios from "axios";

function NavigationBar (props) {
  return (
    <React.Fragment>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <a class="navbar-brand" href="/">
          Articles
        </a>
        <div class="collapse navbar-collapse" id="navbarColor03">
          <ul class="navbar-nav mr-auto">
          {props.pages.map(page => (
          <li>
            <Link key={page.id} href="/page" as={page.slug} class="nav-item">
              <a class="nav-link">{page.title}</a>
            </Link>
          </li>
        ))}
          </ul>
        </div>
      </nav>
    </React.Fragment>
  );
}

NavigationBar.getInitialProps = async () => {
  const res = await axios.get("https://binance-api-example.herokuapp.com/");
  console.log(res.data)
  return { pages: res.data };
};

export default NavigationBar;
